!

!
version 12.3
service timestamps debug datetime msec
service timestamps log datetime msec
no service password-encryption
!
hostname R3
!
boot-start-marker
boot-end-marker
!
!
memory-size iomem 15
no aaa new-model
ip subnet-zero
no ip icmp rate-limit unreachable
ip tcp synwait-time 5
ip cef
!
!
no ip domain lookup
!
!
!
!
!
!
!
!
!
!
!
!
!
!
!
!
interface Ethernet0/0
 ip address 193.136.212.129 255.255.255.248
 ip nat outside
 half-duplex
!
interface Serial0/0
 no ip address
 shutdown
!
interface FastEthernet1/0
 ip address 10.9.0.1 255.255.255.0
 ip nat inside
 duplex auto
 speed auto
!
ip nat inside source list 30 interface Ethernet0/0 overload
ip nat outside source static tcp 10.9.0.2 80 193.136.212.129 80 extendable
no ip http server
ip classless
ip route 193.136.212.136 255.255.255.248 193.136.212.130
ip route 193.136.212.144 255.255.255.248 193.136.212.131
!
!
access-list 30 permit 10.9.0.0 0.0.0.255
no cdp log mismatch duplex
!
!
!
!
!
!
!
line con 0
 exec-timeout 0 0
 privilege level 15
 logging synchronous
line aux 0
 exec-timeout 0 0
 privilege level 15
 logging synchronous
line vty 0 4
 login
!
!
end
